//10,20 

iteration = 0

while(readdata !=null)
{	
	if(iteration==0)
	{
	readdata = Fileread.readLine()
	iteration++
	}
	String[] propdata = readdata.split(',')
	//log.info readdata
	context.setProperty("intA",propdata[0])
	context.setProperty("intB",propdata[1])
	addrun = testRunner.testCase.testSteps["Addrequest"]
	res =addrun.run(testRunner,context)
	log.info res.status
	readdata = Fileread.readLine()
}

